import React from 'react'

import {
    Link
  } from "react-router-dom";

function Menu() {
  return (
    <div className="menu" role='menubar'>
            <ul>
                <li><Link to="/ " itemProp='url'></Link>Transactions</li>
                <li><Link to="/ReportsPage" itemProp='url'></Link>Reports</li>
                <li><Link to="/AddUserPage" itemProp='url'></Link>Add Users</li>
            </ul>
    </div>
  );
}

export default Menu;
